import {applyMiddleware, compose, createStore} from 'redux';
import thunk from 'redux-thunk';
import rootReducer from 'data/redux/reducers';
import checkLoginMiddleware from "data/redux/middleware/loginCheck";
import checkAdminMiddleware from "data/redux/middleware/adminCheck";
const composeEnhancers = process.env.REACT_APP_ENV === 'real'
    ? compose
    : (typeof window !== 'undefined' && window.__REDUX_DEVTOOLS_EXTENSION_COMPOSE__) || compose;

const store = createStore(rootReducer, composeEnhancers(applyMiddleware(checkLoginMiddleware, checkAdminMiddleware, thunk)));
export default store;
